INSERT INTO `pengacara` VALUES (1,'foto_profile/QdK37Z7Dsis24lMMQT75pVxiwGE4ryqVGri2yHvy.png',1,3674,'Nursamad, S.H.','nursamad@gmail.com','08991921','1000000','Suhendar & Partners','sertifikat_advokat/J2VLQT9ITMLBgU2CHChNtqqYcZ1jVYgz5ERxbB5v.webp','S1 Universitas Pamulang','Nurman Samad adalah seorang pengacara dan penasehat hukum yang berdedikasi tinggi. Dengan pengetahuan mendalam tentang hukum dan etika, beliau selalu siap memberikan pelayanan hukum terbaik bagi kliennya.\r\n\r\nBidang Keahlian:\r\n\r\n1. Hukum Perdata: Membantu dalam penyelesaian sengketa perdata, kontrak, dan masalah keperdataan lainnya.\r\n2. Hukum Pidana: Membela hak-hak terdakwa dalam kasus pidana dan memberikan nasihat hukum yang komprehensif.\r\n3. Hukum Keluarga: Menangani masalah perceraian, hak asuh anak, dan pembagian harta gono-gini.\r\n4. Hukum Bisnis: Menyediakan konsultasi hukum bagi perusahaan, termasuk kontrak bisnis, perizinan, dan kepatuhan hukum.\r\n5. Hukum Pertanahan: Menangani masalah terkait sengketa tanah dan properti.\r\n\r\nPrinsip Kerja:\r\n\r\nIntegritas: Menjunjung tinggi kejujuran dan moralitas dalam setiap kasus.\r\nProfesionalisme: Memberikan pelayanan hukum dengan standar profesional tertinggi.\r\nKeterlibatan Klien: Melibatkan klien dalam setiap langkah proses hukum untuk memastikan transparansi dan pemahaman yang jelas.\r\nKeberlanjutan: Mengupayakan solusi hukum yang tidak hanya efektif, tetapi juga berkelanjutan dan berorientasi pada masa depan.\r\nPengalaman:\r\nDengan bertahun-tahun pengalaman dalam berbagai bidang hukum, Nurman Samad telah membantu banyak klien dalam menyelesaikan masalah hukum mereka dengan hasil yang memuaskan. Beliau dikenal atas kemampuannya dalam menganalisis kasus secara mendalam dan memberikan solusi yang inovatif dan efektif.\r\n\r\nVisi:\r\nMenjadi pengacara yang tidak hanya membantu klien dalam masalah hukum, tetapi juga sebagai mitra dalam mencapai keadilan dan kesejahteraan bagi masyarakat luas.','2024-07-14 01:23:56','2024-07-14 01:23:56'),(2,'foto_profile/YxpLCOZAzUhlprndljoeAaaj5DLH4lCDRC3oAfQz.png',2,3674,'Dr. Suhendar, S.H. M.H','suhendar@gmail.com','081231139921','1000000','Suhendar & Partners','sertifikat_advokat/PlejJZzsZqDQUFkqf9Gt37W4O8FfeudaZyxmxYTP.webp','S2 Universitas Pamulang','Dr. Suhendar, S.H. M.H adalah seorang pengacara dan penasehat hukum yang berdedikasi dalam memberikan layanan hukum berkualitas tinggi. Dengan latar belakang pendidikan yang solid dan pengalaman praktis yang luas, saya berkomitmen untuk melindungi hak-hak dan kepentingan klien saya dengan profesionalisme dan integritas.\r\n\r\nSpesialisasi:\r\n\r\nHukum Bisnis: Menyediakan konsultasi hukum bagi perusahaan dalam berbagai aspek termasuk pendirian perusahaan, kontrak bisnis, perizinan, dan kepatuhan hukum.\r\nHukum Pidana: Membela dan mewakili klien dalam kasus-kasus pidana, memastikan hak-hak mereka dilindungi selama proses hukum.\r\nHukum Keluarga: Mengatasi masalah hukum yang berkaitan dengan perceraian, hak asuh anak, dan pembagian harta bersama dengan pendekatan yang empatik dan solutif.\r\nHukum Pertanahan: Menyelesaikan sengketa tanah dan properti dengan pendekatan yang teliti dan berdasarkan hukum yang berlaku.\r\nHukum Perdata: Menangani berbagai jenis sengketa perdata dengan fokus pada penyelesaian yang adil dan efisien.\r\nFilosofi Kerja:\r\n\r\nTransparansi: Menjaga keterbukaan dalam komunikasi dengan klien, memastikan mereka selalu terinformasi dengan baik mengenai perkembangan kasus mereka.\r\nKeberanian: Tidak gentar menghadapi tantangan hukum dan selalu berjuang untuk keadilan.\r\nKeahlian: Terus mengembangkan pengetahuan dan keterampilan hukum untuk memberikan solusi terbaik bagi klien.\r\nEmpati: Memahami situasi dan kebutuhan klien, serta memberikan dukungan yang sesuai dengan kondisi mereka.\r\nPengalaman Profesional:\r\nSaya telah menangani berbagai kasus yang mencakup bidang hukum pidana, perdata, bisnis, keluarga, dan pertanahan. Setiap kasus memberikan pelajaran berharga yang memperkaya keahlian dan kemampuan saya dalam menghadapi berbagai situasi hukum.\r\n\r\nMisi:\r\nUntuk memberikan layanan hukum yang dapat diandalkan dan berkualitas tinggi, serta menjadi mitra yang terpercaya bagi klien dalam setiap langkah perjalanan hukum mereka. Saya percaya bahwa keadilan adalah hak setiap orang dan saya berkomitmen untuk membantu klien saya mencapainya.','2024-07-14 01:50:04','2024-07-14 01:50:04');
